import React, { Component } from "react";
import AOS from "aos";
import "aos/dist/aos.css";

export default class Experience extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <center>
        <div>
          <p className="text">My Job Experiences</p>
        </div>
      </center>
    );
  }
}
